import React from 'react';
import './Header.css';
import { Link } from 'react-router-dom';
import Logo from '../../assets/imagens/logo.png';

function Header() {
  return (
    <header className="header">
      <div className="header-container">
        {/* Logo */}
        <div className="logo">
          <Link to="/home">
            <img src={Logo} alt="Logo do Meu Portfólio" />
          </Link>
        </div>

        {/* Navegação */}
        <nav className="navbar">
          <ul className="nav-links">
            <li>
              <Link to="/projects" className="nav-item">Jogos</Link>
            </li>
            <li>
              <Link to="/about" className="nav-item">Sobre</Link>
            </li>
            <li>
              <Link to="/contact" className="nav-item">Contato</Link>
            </li>
            <li>
              <Link to="/blog" className="nav-item">Blog</Link>
            </li>
          </ul>
        </nav>

        {/* Botão de ação */}
        <div className="cta-button">
          <Link to="/inscricao" className="button">
            Fale de você
          </Link>
        </div>
      </div>
    </header>
  );
}

export default Header;
